import React, { useState, useCallback, useEffect } from "react";
import { 
  View, 
  FlatList, 
  ActivityIndicator, 
  Alert, 
  StyleSheet,
  Text,
  TouchableOpacity,
  TextInput,
  RefreshControl
} from "react-native";
import { useFocusEffect, useRoute, RouteProp } from "@react-navigation/native";
import { getProdutos } from "../api";
import ProductItem from "../components/ProductItem";
import { debugLog, errorLog, showError, showDebugInfo } from "../utils/debug";

type RootStackParamList = {
  Products: { reload?: boolean } | undefined;
  NewProduct: { produto?: any } | undefined;
};

type ProductsScreenRouteProp = RouteProp<RootStackParamList, "Products">;

export default function ProductsScreen({ navigation }: any) {
  const [produtos, setProdutos] = useState<any[]>([]);
  const [loading, setLoading] = useState(true);
  const [refreshing, setRefreshing] = useState(false);
  const [search, setSearch] = useState("");

  const route = useRoute<ProductsScreenRouteProp>();

  // Função para carregar produtos
  const carregarProdutos = async (searchTerm?: string, showLoading = true) => {
    try {
      if (showLoading) {
        setLoading(true);
      }
      
      debugLog('Carregando produtos', { searchTerm, showLoading });
      
      const response = await getProdutos(searchTerm);
      
      if (response.data.success) {
        setProdutos(response.data.data);
        debugLog('Produtos carregados com sucesso', { 
          count: response.data.data.length 
        });
      } else {
        throw new Error(response.data.error || 'Resposta inválida do servidor');
      }
      
    } catch (error: any) {
      errorLog('Erro ao carregar produtos', error);
      showError(
        "Erro",
        "Não foi possível carregar os produtos. Verifique sua conexão.",
        error
      );
    } finally {
      if (showLoading) {
        setLoading(false);
      }
    }
  };

  // Função para refresh (pull to refresh)
  const onRefresh = useCallback(async () => {
    setRefreshing(true);
    await carregarProdutos(search, false);
    setRefreshing(false);
  }, [search]);

  // Atualiza lista sempre que a tela volta ao foco
  useFocusEffect(
    useCallback(() => {
      debugLog('ProductsScreen focusEffect triggered');
      carregarProdutos();
    }, [])
  );

  // Recarrega se NewProduct mandar o parâmetro reload
  useEffect(() => {
    if (route.params?.reload) {
      debugLog('Reload solicitado via parâmetro');
      carregarProdutos();
      
      // Limpar o parâmetro para não entrar em loop
      navigation.setParams({ reload: undefined });
    }
  }, [route.params?.reload]);

  // Busca com debounce
  const handleSearch = useCallback((text: string) => {
    setSearch(text);
    
    // Debounce: só busca se tiver mais de 2 caracteres ou estiver vazio
    if (text.length > 2 || text.length === 0) {
      const timeoutId = setTimeout(() => {
        carregarProdutos(text);
      }, 500); // 500ms de delay

      return () => clearTimeout(timeoutId);
    }
  }, []);

  // Navegar para edição/criação de produto
  const handleProductPress = (produto: any) => {
    debugLog('Navegando para edição de produto', { id: produto.id, nome: produto.nome });
    navigation.navigate("NewProduct", { produto });
  };

  const handleAddProduct = () => {
    debugLog('Navegando para criação de produto');
    navigation.navigate("NewProduct");
  };

  // Renderizar item da lista
  const renderProductItem = ({ item }: { item: any }) => (
    <ProductItem 
      produto={item} 
      onPress={() => handleProductPress(item)}
    />
  );

  // Renderizar empty state
  const renderEmptyState = () => (
    <View style={styles.emptyContainer}>
      <Text style={styles.emptyIcon}>📦</Text>
      <Text style={styles.emptyTitle}>
        {search ? 'Nenhum produto encontrado' : 'Nenhum produto cadastrado'}
      </Text>
      <Text style={styles.emptySubtitle}>
        {search 
          ? 'Tente buscar por outro termo' 
          : 'Comece cadastrando seu primeiro produto'
        }
      </Text>
      {!search && (
        <TouchableOpacity 
          style={styles.emptyButton}
          onPress={handleAddProduct}
        >
          <Text style={styles.emptyButtonText}>Cadastrar Produto</Text>
        </TouchableOpacity>
      )}
    </View>
  );

  // Loading state
  if (loading) {
    return (
      <View style={styles.container}>
        {/* Header */}
        <View style={styles.header}>
          <TouchableOpacity 
            style={styles.backButton}
            onPress={() => navigation.goBack()}
          >
            <Text style={styles.backButtonText}>← Voltar</Text>
          </TouchableOpacity>
          <Text style={styles.title}>Estoque Inteligente</Text>
          {__DEV__ && (
            <TouchableOpacity 
              style={styles.debugButton}
              onPress={showDebugInfo}
            >
              <Text style={styles.debugButtonText}>🔧</Text>
            </TouchableOpacity>
          )}
        </View>
        
        <View style={styles.loadingContainer}>
          <ActivityIndicator size="large" color="#2196F3" />
          <Text style={styles.loadingText}>Carregando produtos...</Text>
        </View>
      </View>
    );
  }

  return (
    <View style={styles.container}>
      {/* Header */}
      <View style={styles.header}>
        <TouchableOpacity 
          style={styles.backButton}
          onPress={() => navigation.goBack()}
        >
          <Text style={styles.backButtonText}>← Voltar</Text>
        </TouchableOpacity>
        <Text style={styles.title}>Estoque Inteligente</Text>
        <Text style={styles.subtitle}>
          {produtos.length} produto{produtos.length !== 1 ? 's' : ''} cadastrado{produtos.length !== 1 ? 's' : ''}
        </Text>
        
        {/* Botão de debug (apenas em desenvolvimento) */}
        {__DEV__ && (
          <TouchableOpacity 
            style={styles.debugButton}
            onPress={showDebugInfo}
          >
            <Text style={styles.debugButtonText}>🔧</Text>
          </TouchableOpacity>
        )}
      </View>

      {/* Busca */}
      <View style={styles.searchContainer}>
        <TextInput
          style={styles.searchInput}
          placeholder="🔍 Buscar produtos..."
          value={search}
          onChangeText={handleSearch}
          placeholderTextColor="#999"
          returnKeyType="search"
        />
      </View>
      
      {/* Lista */}
      <FlatList
        data={produtos}
        keyExtractor={(item) => item.id.toString()}
        renderItem={renderProductItem}
        contentContainerStyle={[
          styles.listContainer,
          produtos.length === 0 && styles.listContainerEmpty
        ]}
        showsVerticalScrollIndicator={false}
        refreshControl={
          <RefreshControl
            refreshing={refreshing}
            onRefresh={onRefresh}
            colors={['#2196F3']}
            tintColor="#2196F3"
          />
        }
        ListEmptyComponent={renderEmptyState}
        // Performance otimizations
        removeClippedSubviews={true}
        maxToRenderPerBatch={10}
        updateCellsBatchingPeriod={50}
        initialNumToRender={10}
        getItemLayout={(data, index) => ({
          length: 120, // altura estimada do item
          offset: 120 * index,
          index,
        })}
      />

      {/* Botão flutuante para adicionar */}
      <TouchableOpacity
        style={styles.floatingButton}
        onPress={handleAddProduct}
        activeOpacity={0.8}
      >
        <Text style={styles.floatingButtonText}>+</Text>
      </TouchableOpacity>
    </View>
  );
}

const styles = StyleSheet.create({
  container: { 
    flex: 1, 
    backgroundColor: '#f5f5f5' 
  },
  loadingContainer: { 
    flex: 1, 
    justifyContent: 'center', 
    alignItems: 'center' 
  },
  loadingText: { 
    marginTop: 10, 
    color: '#666',
    fontSize: 16
  },
  header: { 
    backgroundColor: '#2196F3', 
    paddingTop: 50, 
    paddingBottom: 20, 
    paddingHorizontal: 20, 
    alignItems: 'center',
    position: 'relative'
  },
  backButton: { 
    position: 'absolute', 
    left: 20, 
    top: 55 
  },
  backButtonText: { 
    color: 'white', 
    fontSize: 16,
    fontWeight: '600'
  },
  debugButton: {
    position: 'absolute',
    right: 20,
    top: 55,
    width: 30,
    height: 30,
    justifyContent: 'center',
    alignItems: 'center',
  },
  debugButtonText: {
    fontSize: 20,
  },
  title: { 
    fontSize: 24, 
    fontWeight: 'bold', 
    color: 'white', 
    marginBottom: 5 
  },
  subtitle: { 
    fontSize: 14, 
    color: 'white', 
    opacity: 0.9 
  },
  searchContainer: { 
    padding: 20 
  },
  searchInput: { 
    backgroundColor: 'white', 
    borderRadius: 25, 
    paddingHorizontal: 20, 
    paddingVertical: 12, 
    fontSize: 16, 
    elevation: 2, 
    shadowColor: '#000', 
    shadowOffset: { width: 0, height: 1 }, 
    shadowOpacity: 0.22, 
    shadowRadius: 2.22 
  },
  listContainer: { 
    paddingHorizontal: 20, 
    paddingBottom: 100 
  },
  listContainerEmpty: {
    flex: 1,
  },
  emptyContainer: {
    flex: 1,
    justifyContent: 'center',
    alignItems: 'center',
    paddingHorizontal: 40,
  },
  emptyIcon: {
    fontSize: 64,
    marginBottom: 20,
  },
  emptyTitle: {
    fontSize: 20,
    fontWeight: '600',
    color: '#333',
    marginBottom: 8,
    textAlign: 'center',
  },
  emptySubtitle: {
    fontSize: 16,
    color: '#666',
    textAlign: 'center',
    marginBottom: 30,
    lineHeight: 22,
  },
  emptyButton: {
    backgroundColor: '#2196F3',
    paddingHorizontal: 30,
    paddingVertical: 12,
    borderRadius: 25,
  },
  emptyButtonText: {
    color: 'white',
    fontSize: 16,
    fontWeight: '600',
  },
  floatingButton: { 
    position: 'absolute', 
    bottom: 30, 
    right: 30, 
    width: 60, 
    height: 60, 
    backgroundColor: '#FF9800', 
    borderRadius: 30, 
    justifyContent: 'center', 
    alignItems: 'center', 
    elevation: 5, 
    shadowColor: '#000', 
    shadowOffset: { width: 0, height: 2 }, 
    shadowOpacity: 0.25, 
    shadowRadius: 3.84 
  },
  floatingButtonText: { 
    color: 'white', 
    fontSize: 28, 
    fontWeight: 'bold' 
  },
});
